import {
  GET_ACTU,
  UPDATE_ACTU,
  DELETE_ACTU,
  GET_ACTU_BY_ID,
} from "../constants/reducers";
const initialState = {};

export default function (state = initialState, action) {
  switch (action.type) {
    default:
      return state;
  }
}
